import React from 'react';

const ColabClients = () => {
  const [colabs, setColabs] = useState([
        {
          id: 1,
          title: 'Service 1',
          description: 'Description for Service 1',
        },
        {
          id: 2,
          title: 'Service 2',
          description: 'Description for Service 2',
        },
        {
          id: 3,
          title: 'Service 3',
          description: 'Description for Service 3',
        }
  ]);    





  return (
    <div>
        <div>
            <div>
            <div className="clients-container">
                <h2>Nuestros Clientes</h2>
                <div className="cards-secondary-container">
                {colabs.map((service) => (
                    <ClientCard key={service.id} title={service.title} description={service.description} />
                ))}
                </div>
            </div>
            </div>
        </div>
        <div className="colaborators-container">
        <h2>Nuestros Colaboradores</h2>
        <div className="cards-secondary-container">
            {colabs.map((service) => (
            <ColabsCard key={service.id} title={service.title} description={service.description} />
            ))}
        </div>
        </div>
    </div>
  );
};

export default ColabClients;
